import FilterLink from "../containers/FilterLink";

const Footer = () => {
  return (
    <p>
      Show: <Link>All</Link>
      {", "}
      <Link>Active</Link>
      {", "}
      <Link>Completed</Link>
    </p>
  );
};

export default Footer;
